import React from "react";

const Contacts = ({ contacts }) => {
  return (
    <>
      <div>
        <h2>Contacts</h2>
        <ul>
          {contacts.map((contact) => (
            <li key={contact.id}>{contact.name}</li>
          ))}
        </ul>
      </div>
    </>
  );
};

export default Contacts;
